	add("pishogue", "{\"term\":\"pishogue\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Irish\", \"middle irish (900-1200)\"], \"text\":\"Anglo-Irish, from Irish \u0027piseog\u0027 (witchcraft) from Middle irish (900-1200) \u0027piseóc\u0027 \u0027pisóc\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Magic, witchcraft; a spell, especially one designed to cause or cure illnesses to man or beast, or to increase or decrease the quantities of farm products such as butter or milk\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1829\u0027\u0027, Gerald Griffin, \u0027The Collegians\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Pishog: A mystic rite, by which one person is enabled to make a supernatural transfer of his neighbour\u0027s butter into his own churns\", \"priority\":3}]}, \"synonyms\":{}}");

