	add("pisspot", "{\"term\":\"pisspot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|piss|pot|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A portable container used for urination, especially in hospitals or in the absence of indoor plumbing; a chamber pot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027, w:Aleister Aleister Crowley, John Symonds, Kenneth Grant (editors), \u0027The Magical Record of the Beast 666: The Diaries of Aleister Crowley, 1914-1920\u0027, %22pisspots%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22pisspot%22|%22pisspots%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dxo_aT4aiBcuRiQew9KCnAg\u0026amp;redir_esc\u003dy page 103\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Beauty looks like a \u0027\u0027pisspot\u0027\u0027. I tell her so. A compliment because the golden urine of life is poured into her by her Father the Sun. Hence, the Sun is sitting on a \u0027\u0027pisspot\u0027\u0027. That \u0027\u0027pisspot\u0027\u0027 is the Zodiac\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027 w:Angela Angela Carter, \u0027Fireworks\u0027, 1987, [http://books.google.com.au/books?id\u003dwzUgAQAAIAAJ\u0026amp;q\u003d%22he+was+fumbling+in+his+little+night-table,+where+he+keeps+his+pisspot%22\u0026amp;dq\u003d%22he+was+fumbling+in+his+little+night-table,+where+he+keeps+his+pisspot%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dmQbbT7D9AuW0iQfW2tWoCg\u0026amp;redir_esc\u003dy page 115\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He was fumbling in his little night-table, where he keeps his \u0027\u0027pisspot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, w:Gregory Gregory Maguire, \u0027w:Confessions of an Ugly Confessions of an Ugly Stepsister\u0027, %22pisspots%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deR7bT_T9HaSiiAfJwYSWCg\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"%22pisspots%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 252\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Upstairs, Cornelius van den Meer is calling for the \u0027\u0027pisspot\u0027\u0027 to be emptied\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A very unpleasant, nasty, or mean-spirited person; a contemptible person\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, w:Ben Ben Bova, \u0027Mars\u0027 %22pisspots%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d0TzbT4X0MKK3iQect6mWCg\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"%22pisspots%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"That ought to satisfy the \u0027\u0027pisspot\u0027\u0027 sons of bitches, he thought as he transmitted his apology to the spacecraft orbiting above\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, w:James Lee James Lee Burke, \u0027Cadillac Jukebox\u0027, %22pisspots%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deR7bT_T9HaSiiAfJwYSWCg\u0026amp;redir_esc\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"%22pisspots%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"‘I′m sorry about your place. It′s not my doing,’ I said\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"‘Like hell it isn′t.’ Then a yellow tooth glinted behind his lip and he added, ‘You little \u0027\u0027pisspot\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Frederick Nolan, \u0027The West of Billy the Kid\u0027, %22pisspots%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deR7bT_T9HaSiiAfJwYSWCg\u0026amp;redir_esc\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"%22pisspots%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 287\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"By now a large crowd had gathered; when she learned the kid was dead a sobbing Deluvina Maxwell cursed Garrett and pounded his chest. “You \u0027\u0027pisspot\u0027\u0027!” she raged, “you sonofabitch\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"An extremely unpleasant or disgusting place; anything mean or worthless\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, David Drake, \u0027The Way To Glory\u0027, %22pisspots%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dqDDbT_PmFsmuiQee1fixCg\u0026amp;redir_esc\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"%22pisspots%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"He sailed it out the hatch into the harbor, then shrugged off the wrap and balanced it in his hand. “Do for wiping rags, I guess,” he muttered. “I won′t be sorry to look down on this \u0027\u0027pisspot\u0027\u0027 world, though\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, David Wellington, \u0027Monster Island\u0027, %22pisspots%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dqDDbT_PmFsmuiQee1fixCg\u0026amp;redir_esc\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"%22pisspots%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"It was only the \u0027\u0027pisspots\u0027\u0027 of the world that made it. The most dangerous places. The unstable countries, the feudal states, the anarchic backwaters, places you wouldn′t dare walk out the door without a gun, where bodyguards were fashion accessories—those places did a lot better in the end\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, w:George R. R. George R. R. Martin, \u0027A Song of Ice and Fire 5: A Dance With Dragons\u0027, %22pisspots%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dqDDbT_PmFsmuiQee1fixCg\u0026amp;redir_esc\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"%22pisspots%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"“It should have been you who threw the feast, to welcome me back,” Ramsay complained, “and it should have been in Barrow Hall, not this \u0027\u0027pisspot\u0027\u0027 of a castle\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"A regular drinker of large quantities of alcohol; a drunkard\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, Ronald F. Holt (editor), \u0027The Strength of Tradition: Stories of the Immigrant Presence in Australia, 1970-81\u0027, %22pisspots%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22pisspot%22|%22pisspots%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dxo_aT4aiBcuRiQew9KCnAg\u0026amp;redir_esc\u003dy page 163\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"“Today my son said to me, ‘You\u0027re a \u0027\u0027pisspot\u0027\u0027, dad, a bloody \u0027\u0027pisspot\u0027\u0027.’ You know what that Australian word ‘\u0027\u0027pisspot\u0027\u0027’ means, Kapetan Nikola? A ‘metho’, a drunkard. He called me, his own father, a ‘metho’\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, w:Kate Kate Jennings, \u0027Cold Water\u0027, in \u0027Save Me, Joe Louis\u0027, republished in 2010, \u0027Trouble: Evolution of a Radical, Selected Writings 1970-2010\u0027, %22pisspots%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dFkLbT5TvKq6RiQftq7iJCg\u0026amp;redir_esc\", \"priority\":33},{\"upperType\":\"NOUN\", \"text\":\"%22pisspots%22%20australia%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 77\", \"priority\":34},{\"upperType\":\"NOUN\", \"text\":\"I would get indignant at magazine articles that characterised Australia as a nation of \u0027\u0027pisspots\u0027\u0027. I remember one in particular because I was nearly inspired to write a letter to the editor. ‘Australians,’ claimed the journalist, ‘drank until they threw ip on their shoes.’ And then I realised there was a good deal of truth in all this. Quite a few Australians do drink until they throw up on their shoes. I have done it myself\", \"priority\":35},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Bill Marsh, \u0027Great Australian Railway Stories\u0027, %22pisspots%22+australia+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dFkLbT5TvKq6RiQftq7iJCg\u0026amp;redir_esc\", \"priority\":36},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u0026amp;f\u003dfalse unnumbered page\", \"priority\":37},{\"upperType\":\"NOUN\", \"text\":\"I mean, the bastard was an absolute bloody \u0027\u0027pisspot\u0027\u0027. The prick got the sack later anyway, for being drunk on the job\", \"priority\":38},{\"upperType\":\"NOUN\", \"text\":\"A large quantity\", \"priority\":39},{\"upperType\":\"NOUN\", \"text\":\"1966\u0027\u0027, w:Robert Carson Robert Carson, \u0027The Outsiders\u0027, %22pisspots+of%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22pisspot+of%22|%22pisspots+of%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dS0nbT6KrGMGsiAf3yriwCg\u0026amp;redir_esc\u003dy page 225\", \"priority\":40},{\"upperType\":\"NOUN\", \"text\":\"“Damned successful. In fact, I have made a veritable \u0027\u0027pisspot\u0027\u0027 of money\", \"priority\":41},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, w:Ron Ron Goulart, \u0027Hail Hibbler\u0027, %22pisspots+of%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dS0nbT6KrGMGsiAf3yriwCg\u0026amp;redir_esc\", \"priority\":42},{\"upperType\":\"NOUN\", \"text\":\"%22pisspots%20of%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":43},{\"upperType\":\"NOUN\", \"text\":\"“A whole colony?” Lightnin′ Jim swallowed. “That′ll cost you a whole \u0027\u0027pisspot\u0027\u0027 of loot, Princess\", \"priority\":44}]}, \"synonyms\":{}}");

